database informixoltp; 

create table 'informix'.event_user_results (
 name VARCHAR(254) not null,
 start_time DATETIME YEAR TO FRACTION,
 end_time DATETIME YEAR TO FRACTION,
 handle NVARCHAR(30),
 handle_lower NVARCHAR(30),
 contest_id DECIMAL(10,0),
 registrants DECIMAL(5,0),
 submissions DECIMAL(5,0),
 user_id DECIMAL(12,0),
 placed INT,
 completed DECIMAL(1,0),
 submission_id DECIMAL(10,0)
 )
extent size 128 next size 128
lock mode page; 

